import React from "react";
import Gallery from "./gallery";
import SideBar from "./sideBarComponent";

const MainBanner = () => {
  return (
    <div class="main_banner">
      <div class="right">
        <SideBar /> {/* <RotateImage /> */} {/* <Gallery /> */}
      </div>
      <div class="middel">
        <Gallery />
      </div>{" "}
      <div class="left">
        <img src={requier()} alt="" />
      </div>
    </div>
  );
};
export default MainBanner;
